function About() {
  return (
    <div className="bg-pink-50 min-h-screen p-8 text-center">
      <h1 className="text-3xl font-bold mb-4">About Midnight Spa</h1>
      <p className="text-lg">
        At Midnight Spa, we offer a relaxing and peaceful environment with experienced staff
        from the North East and local areas. We specialize in various massage therapies to
        rejuvenate your body and mind.
      </p>
    </div>
  );
}

export default About;
